Description:
Il s'agit de la veille de la date de début de la prescription de l'arrêt de travail, sauf pour les cas suivants :
- arrêt prescrit lors d'un jour travaillé : le dernier jour travaillé correspond alors à la date de l'arrêt ;
- autres cas particuliers précisés par voie de consignes.

Date à laquelle le salarié est considéré, par le corps médical, apte à exercer à nouveau une activité professionnelle (premier jour travaillé et payé suite à l'arrêt de travail). Il s’agit bien de la date de reprise réelle et non de la date de reprise prévisionnelle à alimenter en rubrique "Date de fin prévisionnelle - S21.G00.60.003". Cette rubrique doit être renseignée dans les situations suivantes :
- A l’occasion de l’émission d'un signalement Arrêt de travail ou Reprise suite à arrêt de travail s’il s’agit d’une reprise anticipée uniquement. Si cette date est connue au moment de l’émission du signalement mais qu’elle n’intervient pas avant la date de fin prévisionnelle, elle ne doit pas être valorisée ;
- A l’occasion de l’émission d'un signalement FCTU si cette date est connue au moment de l'émission de ce signalement ;
- Au moment de la constitution de la DSN mensuelle consécutive à la prise de connaissance de la reprise de travail par le gestionnaire de paie.
